    render() {
        return (
            <Box className="container">
                <Box className="header-container">
                    <Box>
                        <p>Assignee:</p>
                    </Box>
                </Box>
                <Box className="table-container"></Box>
            </Box>
        )
    }
}

export default TrainingData
